import './css/Turtle.css';
import React from 'react';
import { Link } from 'react-router-dom';

function Where_Link(props) {
    return(
        <div>
            <Link to={props.to}><img src={props.src} className='Where_Link' alt={props.alt}></img></Link>
            <Link to={props.to}><p className='Where_Link_Text'>{props.text}</p></Link>
        </div>
    )
}

export default function Turtle() {
    return(
        <div>
            <div className='menu'>
                <p className='pageName'>거북이 수족관</p>
                <p className='logOut'>로그아웃</p>
                <div className='Turtle_Background'>
                    <div className='UnderTheSea_LinkContainer'>
                        <Link to='/DeepSea'><img src='/UnderTheSea_Link.png' className='Where_Link' alt='DeepSea'></img></Link>
                        <Link to='/DeepSea'><p className='Where_Link_Text'>심해</p></Link>
                    </div>
                    <div className='Space_LinkContainer'>
                        <Link to='/Space'><img src='/Space_Link.png' className='Where_Link' alt='Space'></img></Link>
                    </div>
                </div>  
            </div>
        </div>
    )
}
